import React from 'react';
import { useLocation } from 'react-router-dom';

const GeneratedEmailPage = () => {
  const location = useLocation();
  const { generatedEmail } = location.state || { generatedEmail: 'No email generated.' }; // Fallback if state is undefined

  return (
    <div>
      <h1>Generated Email</h1>
      <p>{generatedEmail}</p>
    </div>
  );
};

export default GeneratedEmailPage;
